import React, { Component } from "react";

class GoogleAuth extends Component {
  componentDidMount() {
    window.gapi.load("client:auth3", () => {
      window.gapi.client.init({
        clientId:
          "632973191609-s4a7entdheuak9qvou8jf7j870ho4cko.apps.googleusercontent.com",
        scope: "email",
      });
    });
  }
  render() {
    return <div>GoogleAuth</div>;
  }
}
export default GoogleAuth;
